import axios from "axios";
function GetListCinemaBrandRequest(id) {
  return (dispatch) => {
    axios({
      method: "post",
      url: "/user/12345",
      data: {
        firstName: "Fred",
        lastName: "Flintstone",
      },
    });
  };
}
export { GetListCinemaBrandRequest };
